//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./bean.sol";

contract Cryptobucks {
    // Token Contract
    Bean bean;
    // Incinerator
    address public incinerator;
    // user data
    uint256 public userCount;
    mapping (address => uint256) public userToId;
    mapping (uint256 => address) public useridToUserAddress;
    mapping (uint256 => string) public userIdToName;
    mapping (uint256 => uint256) public userIdToPhone;
    mapping (uint256 => string) public userIdToLocation;
    mapping (uint256 => uint256) public userIdToDiscount;

    // store data
    address payable owner;
    uint256 public collateral; // multiplier to product price. If price = 5eth, collateral = 2, then user pays 10eth and 5eth is refunded on fulfillment.
    uint256 public productCount;
    uint256 public discountPerToken; // % discount in eth per token. If price = 5eth, tokens redeemed = 2, discount = 10% then user pays 5 - 2*0.1 = 4.8 eth.
    uint256 public tokenPerUnitPrice; // %age
    mapping (uint256 => string) public productIdToName;
    mapping (uint256 => uint256) public productIdToPrice;

    // orders
    uint256 public orderCount;
    enum OrderStatus {
        UNPLACED, LIVE, FULFILLED
    }
    mapping(uint256 => uint256) public orderIdToProductId;
    mapping(uint256 => OrderStatus) public orderIdTostatus;
    mapping(uint256 => uint256) public orderIdTouserId;

    // events
    event productCreated (uint256 productId, string productName, uint256 productPrice);
    event userCreated (address user, uint256 userId);
    event orderPlaced (uint256 orderId, uint256 productId, uint256 userId);
    event orderFulfilled (uint256 orderId);

    constructor(address _beanAddress, address _incinerator) {
        userCount = 0;
        bean = Bean(_beanAddress);
        productCount = 0;
        owner = payable(msg.sender);
        orderCount = 0;        
        incinerator = _incinerator;

    }

    function setStoreData ( uint256 _collateral, uint256 _discount, uint256 _tokenPerUnit) public {
        require (msg.sender == owner, "Only owner can set these values.");
        collateral = _collateral;
        discountPerToken = _discount;
        tokenPerUnitPrice = _tokenPerUnit;
    }

    function createProduct (string memory _name, uint256 _price) public {
        require (msg.sender == owner, "Only store owner can create products.");
        require (_price > 0, "The product should have a price.");
        productCount = productCount + 1;
        productIdToName[productCount] = _name;
        // price in wei.
        productIdToPrice[productCount] = _price;
        emit productCreated(productCount, _name, _price);
    }

    function userSignUp (string memory _name, uint256 _phoneNumber, string memory _location) public {
        require (userToId[msg.sender] <= 0, "User already exists");
        userCount = userCount + 1;
        userToId[msg.sender] = userCount;
        useridToUserAddress[userCount] = msg.sender;
        userIdToName[userCount] = _name;
        userIdToPhone[userCount] = _phoneNumber;
        userIdToLocation[userCount] = _location;
        emit userCreated(msg.sender, userCount);
    }

    function redeemTokens (uint256 _tokenNumber) public {
        bean.transferFrom(msg.sender, incinerator,  _tokenNumber);
        uint256 discountEarned = discountPerToken * _tokenNumber / 100;
        userIdToDiscount[userToId[msg.sender]] = userIdToDiscount[userToId[msg.sender]] + discountEarned;
    }

    function placeOrder (uint256 _productId) public payable {
        require (userToId[msg.sender] > 0, "User doesn't exist. Please sign up.");
        require (productIdToPrice[_productId] > 0, "Product doesn't exist.");
        uint256 availableDiscount = userIdToDiscount[userToId[msg.sender]];
        if (availableDiscount > productIdToPrice[_productId]) {
            availableDiscount = productIdToPrice[_productId];
        }
        uint256 priceAfterDiscount = productIdToPrice[_productId] - availableDiscount;
        uint256 priceWithCollateral = priceAfterDiscount + (collateral - 1) * productIdToPrice[_productId];
        require (msg.value >= priceWithCollateral, "Amount less than product price.");
        orderCount = orderCount + 1;
        orderIdToProductId[orderCount] = _productId;
        orderIdTostatus[orderCount] = OrderStatus.LIVE;
        orderIdTouserId[orderCount] = userToId[msg.sender];
        owner.transfer(priceAfterDiscount);
        userIdToDiscount[userToId[msg.sender]] = userIdToDiscount[userToId[msg.sender]] - availableDiscount;
        emit orderPlaced(orderCount, _productId, userToId[msg.sender]);       
    }

    function fulfillOrder (uint256 _orderId) public payable {
        require (orderIdTostatus[_orderId] == OrderStatus.LIVE, "Cannot fulfill an unplaced order.");
        require (useridToUserAddress[orderIdTouserId[_orderId]] == msg.sender, "You did not place this order.");
        orderIdTostatus[_orderId] = OrderStatus.FULFILLED;
        uint256 remainingAmount = (collateral - 1) * productIdToPrice[orderIdToProductId[_orderId]];
        payable(msg.sender).transfer(remainingAmount);
        uint256 tokenReward = tokenPerUnitPrice * productIdToPrice[orderIdToProductId[_orderId]] / 100;
        bean.transfer(msg.sender, tokenReward);
        emit orderFulfilled(_orderId);
    }   


}
